    es: 'Como se indica en su descripción, este estudio es incompatible con los navegadores bbb y necesita un DDD con al menos 222 núcleos de CPU.',
    ml: 'അതിൻ്റെ വിവരണത്തിൽ പറഞ്ഞിരിക്കുന്നതുപോലെ, ഈ പഠനം bbb ബ്രൗസറുമായി (കൾ) പൊരുത്തപ്പെടുന്നില്ല, കൂടാതെ കുറഞ്ഞത് 222 CPU കോറുകളുള്ള ഒരു DDD ആവശ്യമാണ്',
