    it: 'Questo studio necessita di una finestra di navigazione in incognito/privata e questa finestra non lo è. Puoi sistemare questo problema. Utilizzando qualsiasi browser diverso da Safari, apri una finestra di navigazione in incognito ed esegui il collegamento allo studio in quella finestra.\n \n SPIEGAZIONE: Tutti i principali browser ti consentono di aprire una finestra in modalità di navigazione in incognito, anche se il nome varia, ad es. "Incognito", "InPrivate", "Navigazione privata" o "Finestra privata". Tutti i browser tranne Safari segnalano se la pagina web è in modalità di navigazione in incognito. Safari dice sempre di no. La modalità di navigazione in incognito viene generalmente utilizzata per la privacy. EasyEyes lo utilizza per facilitare l\'accesso alla libreria EasyEyes Firebase, necessaria per la calibrazione del suono.',
