    fa: '❓پاسخ تایپ شده با هیچ چیز در پایگاه داده محدود ما مطابقت ندارد. اگر مطمئن هستید که درست است، این هشدار را نادیده بگیرید و تایپ آن را تمام کنید.',
    pl: '❓Wpisana odpowiedź nie pasuje do niczego w naszej ograniczonej bazie danych. Jeśli masz pewność, że jest prawidłowy, zignoruj ​​to ostrzeżenie i dokończ wpisywanie.',
