    hr: "DLAN. Idite na izbornik Postavke ili Opcije, pomaknite se do dna popisa i označite 'O telefonu', 'O uređaju' ili slično. Kopirajte naziv modela i broj u odgovarajuća polja u nastavku.",
    cs: 'DLAŇ. Přejděte do nabídky Nastavení nebo Možnosti, přejděte na konec seznamu a zaškrtněte položky „O telefonu“, „O zařízení“ nebo podobně. Zkopírujte název modelu a číslo do příslušných polí níže.',
    da: 'HÅNDFLADE. Gå til menuen Indstillinger eller Indstillinger, rul til bunden af ​​listen, og tjek ‘Om telefon’, ‘Om enhed’ eller lignende. Kopier modelnavnet og -nummeret til de tilsvarende felter nedenfor.',
