    fi: 'PALM. Siirry Asetukset- tai Asetukset-valikkoon, vieritä luettelon alaosaan ja valitse "Tietoja puhelimesta", "Tietoja laitteesta" tai vastaava. Kopioi mallin nimi ja numero alla oleviin vastaaviin kenttiin.',
