    hy: '111 սմ-ից ավելի, ավելի դժվար է հասնել ձեր համակարգչի ստեղնաշարին, այնպես որ դրա փոխարեն համարձակորեն օգտագործեք ձեր սմարթֆոնի ստեղնաշարը:',
    bg: 'Над 111 см е по-трудно да достигнете клавиатурата на вашия компютър, така че не се колебайте да използвате вместо това клавиатурата на вашия смартфон.',
    'zh-CN':
      '超过 111 厘米，就很难够到计算机键盘，因此请随意使用智能手机上的键盘。',
