    da: 'Ud over 111 cm er det sværere at nå din computers tastatur, så brug gerne tastaturet på din smartphone i stedet for.',
    nl: 'Boven de 111 cm is het moeilijker om het toetsenbord van uw computer te bereiken, dus gebruik gerust het toetsenbord van uw smartphone.',
