    fi: 'Yli 111 cm:n pituudelta on vaikeampi päästä käsiksi tietokoneen näppäimistöön, joten voit käyttää sen sijaan älypuhelimesi näppäimistöä.',
    fr: 'Au-delà de 111 cm, il est plus difficile d’atteindre le clavier de votre ordinateur, alors n’hésitez pas à utiliser plutôt le clavier de votre smartphone.',
