    kn: '111 cm ಮೀರಿ, ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ನ ಕೀಬೋರ್ಡ್ ಅನ್ನು ತಲುಪಲು ಕಷ್ಟವಾಗುತ್ತದೆ, ಆದ್ದರಿಂದ ನಿಮ್ಮ ಸ್ಮಾರ್ಟ್‌ಫೋನ್‌ನಲ್ಲಿ ಕೀಪ್ಯಾಡ್ ಅನ್ನು ಬಳಸಲು ಹಿಂಜರಿಯಬೇಡಿ.',
    ko: '111cm를 넘어서면 컴퓨터 키보드에 손이 닿기 어렵기 때문에 대신 스마트폰의 키패드를 자유롭게 사용해 보세요.',
    lt: 'Daugiau nei 111 cm sunkiau pasiekti kompiuterio klaviatūrą, todėl nedvejodami naudokite savo išmaniojo telefono klaviatūrą.',
