    kn: 'ವಿಳಾಸ ಪಟ್ಟಿಯನ್ನು ಬಹಿರಂಗಪಡಿಸಲು ಮೇಲಿನ ಬಲ ಮೂಲೆಯಲ್ಲಿರುವ ಮೂರು ಅಡ್ಡ ಸಾಲುಗಳನ್ನು ಟ್ಯಾಪ್ ಮಾಡಿ. ಪುಟವನ್ನು ರಿಫ್ರೆಶ್ ಮಾಡಲು ವಿಳಾಸ ಪಟ್ಟಿಯಲ್ಲಿರುವ ವೃತ್ತಾಕಾರದ ಬಾಣದ ಐಕಾನ್ ⤾ ಅನ್ನು ಟ್ಯಾಪ್ ಮಾಡಿ.',
