    lt: 'Norėdami atidaryti „Opera“ meniu, apatiniame meniu bakstelėkite „O“ logotipą. Norėdami atnaujinti puslapį, bakstelėkite apskritos rodyklės piktogramą ⤾, esančią adreso juostoje.',
