    ru: 'ЛОВИТЬ КРЕСТ! Мы нуждаемся в твоей помощи. Айтрекер требует дополнительной подготовки. Как показано стрелкой, когда вы нажимали, трекер думал, что ваш взгляд находится далеко от перекрестия. Пожалуйста, нажимайте на перекрестие в каждой новой позиции. Это игра. Лови крест!',
