    sw: 'KAMATA MSALABA! Tunahitaji msaada wako. Kifuatilia macho kinahitaji mafunzo zaidi. Kama inavyoonyeshwa na mshale, ulipobofya, kifuatiliaji kilifikiri kuwa macho yako yalikuwa mbali na nywele za msalaba. Tafadhali bofya nywele za msalaba katika kila nafasi mpya. Ni mchezo. Shika msalaba!',
