    tr: 'HARCAYI YAKALAYIN! Yardımına ihtiyacımız var. Göz takip cihazının daha fazla eğitime ihtiyacı var. Okla gösterildiği gibi, tıkladığınızda izleyici bakışınızın artı işaretinden uzakta olduğunu düşünüyordu. Lütfen her yeni konumdaki artı işaretine tıklayın. Bu bir oyun. Haçı yakalayın!',
    ur: 'کراس کو پکڑو! ہمیں آپ کی مدد کی ضرورت ہے۔ آئی ٹریکر کو مزید تربیت کی ضرورت ہے۔ جیسا کہ تیر سے دکھایا گیا ہے، جب آپ نے کلک کیا تو ٹریکر نے سوچا کہ آپ کی نگاہیں کراس بالوں سے دور تھیں۔ براہ کرم ہر نئی پوزیشن پر کراس ہیئرز پر کلک کریں۔ یہ ایک کھیل ہے۔ صلیب کو پکڑو!',
