    ja: 'スマートフォンの内蔵マイクを使用する場合、またはスマートフォンに外部マイクを接続する場合は、「スマートフォン」を選択します。それ以外の場合は「USB」を選択します。',
    kn: 'ನಿಮ್ಮ ಸ್ಮಾರ್ಟ್‌ಫೋನ್‌ನ ಆಂತರಿಕ ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ನೀವು ಬಳಸಿದರೆ ಅಥವಾ ಬಾಹ್ಯ ಮೈಕ್ರೊಫೋನ್ ಅನ್ನು ಅದಕ್ಕೆ ಸಂಪರ್ಕಿಸಿದರೆ "ಸ್ಮಾರ್ಟ್‌ಫೋನ್" ಆಯ್ಕೆಮಾಡಿ. ಇಲ್ಲದಿದ್ದರೆ "USB" ಆಯ್ಕೆಮಾಡಿ.',
    ko: '스마트폰의 내장 마이크를 사용하거나, 외부 마이크를 연결하는 경우에는 "스마트폰"을 선택하세요. 그렇지 않으면 "USB"를 선택하십시오.',
    lt: 'Pasirinkite „Išmanusis telefonas“, jei naudojate savo išmaniojo telefono vidinį mikrofoną arba prie jo prijungiate išorinį mikrofoną. Kitu atveju pasirinkite „USB“.',
    ms: 'Pilih "Telefon Pintar" jika anda menggunakan mikrofon dalaman telefon pintar anda atau menyambungkan mikrofon luaran kepadanya. Jika tidak, pilih "USB".',
    no: 'Velg "Smartphone" hvis du bruker smarttelefonens interne mikrofon eller kobler en ekstern mikrofon til den. Ellers velger du "USB".',
    fa: 'اگر از میکروفون داخلی گوشی هوشمند خود استفاده می کنید یا یک میکروفون خارجی به آن وصل می کنید، «Smartphone» را انتخاب کنید. در غیر این صورت "USB" را انتخاب کنید.',
    pl: 'Wybierz „Smartfon”, jeśli korzystasz z wewnętrznego mikrofonu smartfona lub podłączasz do niego mikrofon zewnętrzny. W przeciwnym razie wybierz „USB”.',
    pt: 'Selecione “Smartphone” se você usar o microfone interno do seu smartphone ou conectar um microfone externo a ele. Caso contrário, selecione "USB".',
    ro: 'Selectați „Smartphone” dacă utilizați microfonul intern al smartphone-ului sau conectați un microfon extern la acesta. În caz contrar, selectați „USB”.',
    ru: 'Выберите «Смартфон», если вы используете внутренний микрофон смартфона или подключаете к нему внешний микрофон. В противном случае выберите «USB».',
    sr: 'Изаберите „Паметни телефон“ ако користите унутрашњи микрофон свог паметног телефона или на њега повежете спољни микрофон. У супротном изаберите „УСБ“.',
    su: 'Pilih "Smartphone" upami anjeun nganggo mikropon internal smartphone anjeun atanapi nyambungkeun mikropon éksternal kana éta. Upami teu kitu, pilih "USB".',
    sw: 'Chagua "Smartphone" ikiwa unatumia maikrofoni ya ndani ya simu yako mahiri au unganisha maikrofoni ya nje kwayo. Vinginevyo, chagua "USB".',
    sv: 'Välj "Smartphone" om du använder din smartphones interna mikrofon eller ansluter en extern mikrofon till den. Välj annars "USB".',
    tr: 'Akıllı telefonunuzun dahili mikrofonunu kullanıyorsanız veya ona harici bir mikrofon bağlıyorsanız "Akıllı Telefon"u seçin. Aksi takdirde "USB"yi seçin.',
    ur: 'اگر آپ اپنے اسمارٹ فون کا اندرونی مائیکروفون استعمال کرتے ہیں یا اس سے بیرونی مائیکروفون جوڑتے ہیں تو "اسمارٹ فون" کو منتخب کریں۔ بصورت دیگر "USB" کو منتخب کریں۔',
    it: 'Seleziona "Smartphone" se utilizzi il microfono interno dello smartphone o se colleghi ad esso un microfono esterno. Altrimenti seleziona "USB".',
