    ml: 'ഈ ഫോൺ ഗ്ലാസ്, മഗ്ഗ് അല്ലെങ്കിൽ ക്യാനിൽ ഇടുക. ചുവടെയുള്ള നിർദ്ദേശങ്ങൾ വായിക്കാൻ എന്നെ തിരിക്കുക.',
