    hy: 'Դրեք այս հեռախոսը ապակու, բաժակի կամ տարայի վրա: Պտտեք ինձ՝ ստորև ներկայացված հրահանգները կարդալու համար:',
    bg: 'Поставете този телефон върху чаша, чаша или кутия. Завъртете ме, за да прочета инструкциите по-долу.',
    'zh-CN': '将手机放在玻璃杯、杯子或罐子上。旋转我来阅读下面的说明。',
    'zh-HK': '將手機放在玻璃杯、杯子或罐子上。旋轉我來閱讀下面的說明。',
