    'en-US_1':
      'Put this phone on the glass, mug, or can. Rotate me to read the instructions below.',
    fi: 'Aseta tämä puhelin lasin, mukin tai tölkin päälle. Pyöritä minua lukeaksesi alla olevat ohjeet.',
