    he: 'שים את הטלפון הזה על הזכוכית, הספל או הפחית. סובב אותי כדי לקרוא את ההוראות למטה.',
    hi: 'इस फ़ोन को ग्लास, मग या कैन पर रखें। नीचे दिए गए निर्देशों को पढ़ने के लिए मुझे घुमाएँ।',
    hu: 'Helyezze ezt a telefont az üvegre, bögrére vagy dobozra. Forgassa el az alábbi utasítások elolvasásához.',
    is: 'Settu þennan síma á glasið, krúsina eða dósina. Snúðu mér til að lesa leiðbeiningarnar hér að neðan.',
