    ja: 'この電話をグラス、マ​​グカップ、または缶の上に置きます。回転させて以下の説明を読んでください。',
    kn: 'ಈ ಫೋನ್ ಅನ್ನು ಗಾಜು, ಮಗ್ ಅಥವಾ ಕ್ಯಾನ್ ಮೇಲೆ ಇರಿಸಿ. ಕೆಳಗಿನ ಸೂಚನೆಗಳನ್ನು ಓದಲು ನನ್ನನ್ನು ತಿರುಗಿಸಿ.',
    ko: '이 전화기를 유리잔, 머그잔, 캔 위에 올려두세요. 나를 돌려서 아래 지침을 읽어보세요.',
    lt: 'Padėkite šį telefoną ant stiklo, puodelio ar skardinės. Pasukite mane, kad perskaitytumėte toliau pateiktas instrukcijas.',
    ms: 'Letakkan telefon ini pada gelas, cawan atau tin. Putar saya untuk membaca arahan di bawah.',
    no: 'Sett denne telefonen på glasset, kruset eller boksen. Roter meg for å lese instruksjonene nedenfor.',
