    hr: 'Napredak se prikazuje u glavnom prozoru eksperimenta. Idite tamo sada klikom na gornju karticu "EasyEyes eksperiment".',
    cs: 'Průběh se zobrazuje v hlavním okně experimentu. Přejděte tam nyní kliknutím na kartu „EasyEyes Experiment“ výše.',
    da: 'Fremskridt vises i hovedeksperimentvinduet. Gå venligst dertil nu ved at klikke på fanen "EasyEyes Experiment" ovenfor.',
    nl: 'De voortgang wordt weergegeven in het hoofdexperimentvenster. Ga daar nu heen, door hierboven op het tabblad "EasyEyes Experiment" te klikken.',
    'en-UK':
      'Progress is displayed in the main experiment window. Please go there now, by clicking the "EasyEyes Experiment" tab above.',
    'en-US_1':
      'Progress is displayed in the main experiment window. Please go there now, by clicking the "EasyEyes Experiment" tab above.',
    fi: 'Edistyminen näkyy kokeilun pääikkunassa. Siirry sinne nyt napsauttamalla "EasyEyes Experiment" -välilehteä yllä.',
    fr: 'La progression est affichée dans la fenêtre principale de l’expérience. Veuillez vous y rendre maintenant, en cliquant sur l\'onglet "EasyEyes Experiment" ci-dessus.',
    de: 'Der Fortschritt wird im Hauptfenster des Experiments angezeigt. Bitte gehen Sie jetzt dorthin, indem Sie oben auf die Registerkarte „EasyEyes Experiment“ klicken.',
    el: 'Η πρόοδος εμφανίζεται στο κύριο παράθυρο πειράματος. Μεταβείτε εκεί τώρα, κάνοντας κλικ στην καρτέλα "EasyEyes Experiment" παραπάνω.',
    he: 'ההתקדמות מוצגת בחלון הניסוי הראשי. נא ללכת לשם עכשיו, על ידי לחיצה על הכרטיסייה "ניסוי EasyEyes" למעלה.',
    hi: 'प्रगति मुख्य प्रयोग विंडो में प्रदर्शित होती है। कृपया ऊपर दिए गए "ईज़ीआईज़ एक्सपेरिमेंट" टैब पर क्लिक करके अभी वहां जाएं।',
    hu: 'Az előrehaladás a fő kísérleti ablakban jelenik meg. Kérjük, lépjen oda most a fenti „EasyEyes Experiment” fülre kattintva.',
    is: 'Framvinda er sýnd í aðal tilraunaglugganum. Vinsamlegast farðu þangað núna með því að smella á "EasyEyes Experiment" flipann hér að ofan.',
    id: 'Kemajuan ditampilkan di jendela eksperimen utama. Silakan ke sana sekarang, dengan mengklik tab "EasyEyes Experiment" di atas.',
    ja: '進行状況はメインの実験ウィンドウに表示されます。上の「EasyEyes Experiment」タブをクリックして、今すぐアクセスしてください。',
    kn: 'ಮುಖ್ಯ ಪ್ರಯೋಗ ವಿಂಡೋದಲ್ಲಿ ಪ್ರಗತಿಯನ್ನು ಪ್ರದರ್ಶಿಸಲಾಗುತ್ತದೆ. ಮೇಲಿನ "EasyEyes ಪ್ರಯೋಗ" ಟ್ಯಾಬ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ ದಯವಿಟ್ಟು ಈಗ ಅಲ್ಲಿಗೆ ಹೋಗಿ.',
    ko: '기본 실험 창에 진행 상황이 표시됩니다. 지금 위의 "EasyEyes 실험" 탭을 클릭하여 해당 페이지로 이동하세요.',
    lt: 'Pažanga rodoma pagrindiniame eksperimento lange. Eikite ten dabar, spustelėję aukščiau esantį skirtuką „EasyEyes Experiment“.',
    ms: 'Kemajuan dipaparkan dalam tetingkap percubaan utama. Sila pergi ke sana sekarang, dengan mengklik tab "EasyEyes Experiment" di atas.',
    no: 'Fremdriften vises i hovedeksperimentvinduet. Gå dit nå ved å klikke på "EasyEyes Experiment"-fanen ovenfor.',
    fa: 'پیشرفت در پنجره آزمایش اصلی نمایش داده می شود. لطفاً اکنون با کلیک کردن روی برگه "EasyEyes Experiment" در بالا به آنجا بروید.',
    pl: 'Postęp jest wyświetlany w głównym oknie eksperymentu. Przejdź tam teraz, klikając zakładkę „Eksperyment EasyEyes” powyżej.',
    pt: 'O progresso é exibido na janela principal do experimento. Vá até lá agora, clicando na guia "Experiência EasyEyes" acima.',
    ro: 'Progresul este afișat în fereastra principală a experimentului. Vă rugăm să mergeți acolo acum, făcând clic pe fila „Experiment EasyEyes” de mai sus.',
    ru: 'Прогресс отображается в главном окне эксперимента. Пожалуйста, перейдите туда сейчас, нажав вкладку «EasyEyes Experiment» выше.',
    sr: 'Напредак се приказује у главном прозору експеримента. Идите тамо сада тако што ћете кликнути на картицу „ЕасиЕиес Екперимент“ изнад.',
    su: 'Kamajuan dipintonkeun dina jandela ékspérimén utama. Mangga ka ditu ayeuna, ku ngaklik tab "EasyEyes Experiment" di luhur.',
    sw: 'Maendeleo yanaonyeshwa kwenye dirisha kuu la majaribio. Tafadhali nenda huko sasa, kwa kubofya kichupo cha "EasyEyes Experiment" hapo juu.',
    sv: 'Framsteg visas i experimentets huvudfönster. Gå dit nu genom att klicka på fliken "EasyEyes Experiment" ovan.',
    tr: 'İlerleme durumu ana deneme penceresinde görüntülenir. Lütfen yukarıdaki "EasyEyes Deneyi" sekmesine tıklayarak oraya gidin.',
    ur: 'پیش رفت مرکزی تجربہ ونڈو میں ظاہر ہوتی ہے۔ براہ کرم اوپر "EasyEyes Experiment" ٹیب پر کلک کر کے ابھی وہاں جائیں۔',
    it: 'Il progresso viene visualizzato nella finestra principale dell\'esperimento. Vai lì adesso, facendo clic sulla scheda "Esperimento EasyEyes" qui sopra.',
