    fr: 'Nous avons amélioré la cartographie des angles morts de Li et al. (2020) en ajoutant le scintillement et le contrôle manuel.',
    de: 'Wir haben die Blindspot-Kartierung von Li et al. verbessert. (2020) durch Hinzufügen von Flimmern und manueller Steuerung.',
    el: 'Βελτιώσαμε τη χαρτογράφηση τυφλού σημείου των Li et al. (2020) προσθέτοντας τρεμόπαιγμα και χειροκίνητο έλεγχο.',
    he: 'שיפרנו את מיפוי הנקודה העיוורת של Li et al. (2020) על ידי הוספת הבהוב ושליטה ידנית.',
    hi: 'हमने ली एट अल की ब्लाइंडस्पॉट मैपिंग को बढ़ाया। (2020) झिलमिलाहट और मैनुअल नियंत्रण जोड़कर।',
    hu: 'Javítottuk Li és munkatársai vakfolt-térképezését. (2020) villogás és kézi vezérlés hozzáadásával.',
