    kn: 'ನಾವು Li et al ನ ಬ್ಲೈಂಡ್‌ಸ್ಪಾಟ್ ಮ್ಯಾಪಿಂಗ್ ಅನ್ನು ವರ್ಧಿಸಿದ್ದೇವೆ. (2020) ಫ್ಲಿಕರ್ ಮತ್ತು ಹಸ್ತಚಾಲಿತ ನಿಯಂತ್ರಣವನ್ನು ಸೇರಿಸುವ ಮೂಲಕ.',
    ko: '우리는 Li et al.의 맹점 매핑을 향상시켰습니다. (2020) 깜박임 및 수동 제어를 추가했습니다.',
    lt: 'Patobulinome Li ir kt. (2020), pridedant mirgėjimą ir rankinį valdymą.',
