    pl: 'Udoskonaliliśmy mapowanie martwego punktu Li i in. (2020), dodając migotanie i sterowanie ręczne.',
    pt: 'Melhoramos o mapeamento do ponto cego de Li et al. (2020) adicionando cintilação e controle manual.',
