    su: 'Urang ningkatkeun pemetaan blindspot Li et al. (2020) ku nambihan flicker sareng kontrol manual.',
    sw: 'Tuliboresha ramani ya upofu wa Li et al. (2020) kwa kuongeza flicker na udhibiti wa mwongozo.',
    sv: 'Vi förbättrade blindfläckskartläggningen av Li et al. (2020) genom att lägga till flimmer och manuell kontroll.',
    tr: 'Li ve arkadaşlarının kör nokta haritalamasını geliştirdik. (2020) titreşim ve manuel kontrol ekleyerek.',
    ur: 'ہم نے لی ایٹ ال کی بلائنڈ سپاٹ میپنگ کو بڑھایا۔ (2020) فلکر اور دستی کنٹرول شامل کرکے۔',
    it: 'Abbiamo migliorato la mappatura dei punti ciechi di Li et al. (2020) aggiungendo sfarfallio e controllo manuale.',
